import React, { useState, useEffect } from "react";
import { Settings as SettingsIcon, Edit } from "lucide-react"; // Rename if needed
import Header from "../components/Header";
import Sidebar from "../components/Sidebar";
import FooterLanding from "../components/FooterLanding";


// Rename the component to avoid conflicts
const UserSettings = () => {  
  const [user, setUser] = useState({
    username: "JohnDoe", 
    email: "john.doe@example.com",
    password: "",
    notificationsEnabled: true
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    setTimeout(() => {
      setLoading(false);
    }, 1000);
  }, []);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setUser({
      ...user,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="settings-page">
      <Header />
      <div className="settings-content flex">
        <Sidebar />
        <div className="settings-main p-6 w-full">
          <h2 className="text-3xl font-semibold mb-6">Account Settings</h2>
          <div className="settings-form bg-white p-8 rounded-lg shadow-lg">
            <div className="settings-section mb-6">
              <h3 className="text-xl font-medium text-gray-700 mb-3">User Information</h3>
              <div className="form-group mb-4">
                <label className="text-sm font-medium text-gray-600" htmlFor="username">Username</label>
                <input
                  type="text"
                  id="username"
                  name="username"
                  value={user.username}
                  onChange={handleChange}
                  className="mt-2 p-3 w-full border rounded-md"
                />
              </div>
              <div className="form-group mb-4">
                <label className="text-sm font-medium text-gray-600" htmlFor="email">Email</label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={user.email}
                  onChange={handleChange}
                  className="mt-2 p-3 w-full border rounded-md"
                />
              </div>
            </div>

            <div className="settings-section mb-6">
              <h3 className="text-xl font-medium text-gray-700 mb-3">Security</h3>
              <div className="form-group mb-4">
                <label className="text-sm font-medium text-gray-600" htmlFor="password">Password</label>
                <input
                  type="password"
                  id="password"
                  name="password"
                  value={user.password}
                  onChange={handleChange}
                  className="mt-2 p-3 w-full border rounded-md"
                />
              </div>
            </div>

            <div className="settings-section mb-6">
              <h3 className="text-xl font-medium text-gray-700 mb-3">Notifications</h3>
              <div className="form-group mb-4">
                <label className="text-sm font-medium text-gray-600" htmlFor="notificationsEnabled">Enable Notifications</label>
                <input
                  type="checkbox"
                  id="notificationsEnabled"
                  name="notificationsEnabled"
                  checked={user.notificationsEnabled}
                  onChange={handleChange}
                  className="mt-2"
                />
              </div>
            </div>

            <div className="form-group flex justify-end">
              <button className="bg-blue-600 text-white py-2 px-4 rounded-md shadow-md hover:bg-blue-700">
                Save Changes
              </button>
            </div>
          </div>
        </div>
      </div>
      <FooterLanding />
    </div>
  );
};

export default UserSettings;
